import React from "react";
import Home from "./Home";

const Contact = () => {
  return (
    (<Home />),
    (
      <div className="contact">
        <h1 style={{ color: "white" }}>Contact Us</h1>
        <p style={{ color: "white" }}>
          If you have any questions, please feel free to reach out to us.
        </p>
      </div>
    )
  );
};

export default Contact;
